import React, { useState, useEffect } from 'react'

export default function TripsList() {

  const [trips, setTrips] = useState([])



  useEffect(() => {
    fetch("http://localhost:3000/trips")
    .then( response => response.json())
    .then(json => setTrips(json))

  }, [])

  console.log(trips)


  return (
    <div>
        <h2>Trip List</h2> 
        <ul>
          {trips.map((trip) => (
            <li key={trip.id}>
                <h3>{trip.title}</h3>
            </li>
          ))}
        </ul>
    </div>
  )
}
